const UserForm = () => {
  return (
    <form>
      <div>
        <div>
          <label>Text</label>
          <input type="text" />
        </div>
        <div>
          <label>Number</label>
          <input type="date" />
        </div>
        <div>
          <label>Merhaba</label>
          <input type="number" />
        </div>
        <button type = "submit">Submit</button>
      </div>
    </form>
  );
};

export default UserForm;
